mogoose.connect(uri,options)
    .then(
        ()=>{console.log("Conectado a la DB");},
        err=>{console.log(err);}
    )


app.use(morgan('tiny'));
app.use(cors());
app.use(express.json());
app.use(express.urlencoded({extended:true}));


app.use('/users', require('./routes/users'));
app.use('/login', require('./routes/login'));

